import { useState, useEffect } from 'react';
import "./style.css";
import Posts from './records.json';

export default function DataFetching() {

    const [posts, setPosts] = useState([]);

    useEffect(() => {    
        fetch('records.json')
            .then(res => res.json())
            .then(data => setPosts(data.posts));
    }, []);

    return (
    <div className="post">
        <ul>

                    <h3>{posts.Posts}</h3>


        </ul>
    </div>
    )
}
